PointsAwarded_Chart_1.query:
q = load "${App.Datasets.LoyaltyLedger_ManualActions66.FullyQualifiedName}";
q = filter q by {{column(NQPCurrency_Name_1.selection, ["NQP_Currency"]).asEquality('LoyaltyProgramCurrency_NQP_Currency')}};
q = filter q by 'TransactionType' == "AdjustedPoints_Positive";
q = group q by ('ActivityDate_Year', 'ActivityDate_Month');
q = foreach q generate 'ActivityDate_Year' , 'ActivityDate_Month' , sum('Points') as 'sum_Points';
q = fill q by (dateCols=('ActivityDate_Year','ActivityDate_Month', "Y-M"));
q = foreach q generate 'ActivityDate_Year' +"~~~"+ 'ActivityDate_Month' as 'ActivityDate_Year~~~ActivityDate_Month', sum(q.'sum_Points') as 'AdjustedPoints_Positive';
q = order q by ('ActivityDate_Year~~~ActivityDate_Month' asc);
q = limit q 2000;

